INSERT [dbo].[tb_Error_sri] ([IdError_Sri], [Descripcion_error], [Posible_Causa]) VALUES (N'59', N'Identificación no existe', N'Cuando el número de la identificación del adquirente no existe.')
INSERT [dbo].[tb_Error_sri] ([IdError_Sri], [Descripcion_error], [Posible_Causa]) VALUES (N'60', N'Ambiente ejecución.', N'Siempre que el comprobante sea emitido en ambiente de certificación o pruebas se enviará como parte de la autorización esta advertencia.')
INSERT [dbo].[tb_Error_sri] ([IdError_Sri], [Descripcion_error], [Posible_Causa]) VALUES (N'62', N'Identificación Incorrecta', N'Cuando el número de la identificación del adquirente del comprobante está incorrecta. Por ejemplo cédulas no pasan el dígito verificador.')
INSERT [dbo].[tb_Error_sri] ([IdError_Sri], [Descripcion_error], [Posible_Causa]) VALUES (N'63', N'RUC clausurado', N'Cuando el RUC del emisor se encuentra clausurado por procesos de control de la Administración Tributaria.')
INSERT [dbo].[tb_Error_sri] ([IdError_Sri], [Descripcion_error], [Posible_Causa]) VALUES (N'64', N'Código documento sustento', N'Cuando el código del documento sustento no existe en el catálogo de documentos que se tiene en la Administración.')
INSERT [dbo].[tb_Error_sri] ([IdError_Sri], [Descripcion_error], [Posible_Causa]) VALUES (N'65', N'Fecha de emisión extemporánea', N'Cuando el comprobante emitido no fue enviado de acuerdo al tiempo del tipo de emisión en el cual fue realizado.')
INSERT [dbo].[tb_Error_sri] ([IdError_Sri], [Descripcion_error], [Posible_Causa]) VALUES (N'66', N'Clave reportada', N'Cuando el comprobante es emitido en tipo de emisión contingente y utilizan una clave que ya fue registrada para otros comprobante en el mismo tipo de emisión.')
INSERT [dbo].[tb_Error_sri] ([IdError_Sri], [Descripcion_error], [Posible_Causa]) VALUES (N'67', N'Fecha inválida', N'Cuando existe errores en el formato de la fecha.')
INSERT [dbo].[tb_Error_sri] ([IdError_Sri], [Descripcion_error], [Posible_Causa]) VALUES (N'68', N'Documento Sustento', N'Cuando el comprobante relacionado no existe como electrónico.')
INSERT [dbo].[tb_Error_sri] ([IdError_Sri], [Descripcion_error], [Posible_Causa]) VALUES (N'69', N'Identificación del receptor', N'Cuando la identificación asociada al adquirente no existe. En general cuando el RUC del adquirente no existe en el Registro Único de Contribuyentes.')
INSERT [dbo].[tb_Error_sri] ([IdError_Sri], [Descripcion_error], [Posible_Causa]) VALUES (N'70', N'Clave de acceso en procesamiento', N'Cuando se desea enviar un comprobante que ha sido enviado anteriormente y el mismo no ha terminado su procesamiento')
INSERT [dbo].[tb_Error_sri] ([IdError_Sri], [Descripcion_error], [Posible_Causa]) VALUES (N'71', N'El ruc de la cabecera del lote es diferente al ruc del comprobante recibido', N'Cuando el ruc del emisor de la cabecera del comprobante que forma un lote es diferente al ruc del emisor de la cabecera del lote masivo.')
INSERT [dbo].[tb_Error_sri] ([IdError_Sri], [Descripcion_error], [Posible_Causa]) VALUES (N'72', N'Error al procesar el xml del comprobante recibido al obtener el ruc del archivo xml.', N'Cuando el ruc del emisior de cada comprobante que pertenece al lote masivo se encuentra mal formado en su estructura.')
INSERT [dbo].[tb_Error_sri] ([IdError_Sri], [Descripcion_error], [Posible_Causa]) VALUES (N'74', N'El código de documento de la cabecera del lote es diferente al código del documento del comprobante recibido', N'Cuando el codDoc de la cabecera del lote masivo es diferente al codDoc de la cabecera del comprobante recibido que forma parte del lote masivo.')
INSERT [dbo].[tb_Error_sri] ([IdError_Sri], [Descripcion_error], [Posible_Causa]) VALUES (N'75', N'Error en el código del documento del lote', N'Cuando el codDoc del documento del lote masivo es diferente a los códigos de documentos de los comprobantes que son admitidos(Facturas, Notas de Crédito, Notas de Débito, Guías de Remisión, Comprobantes de Retención).')
INSERT [dbo].[tb_Error_sri] ([IdError_Sri], [Descripcion_error], [Posible_Causa]) VALUES (N'77', N'Error de conversión en la estructura del archivo xml del comprobante del lote', N'Cuando el CodDoc de la cabecera del comprobante que pertenece a un lote masivo está formado por letras, está vacío, o no tiene el tag. Cuando en la cabecera del comprobante que pertenece a un lote masivo, en el Ruc del Emisor se envía un número de Ruc que no se encuentra en las bases del SRI.')
